import {theme} from '@chakra-ui/core';

const tabsystemTheme = {
    ...theme,
    colors: {
        ...theme.colors,
        //space cadet (purple color)
        first: {
            100: '#222E50',
            200: '#1F2947',
            300: '#192139'
        },
        //Blue Sapphire (blue color)
        second: {
            100: '#0088A3',
            200: '#00778F',
            300: '#00667A'
        },
        //Illuminating Emerald (teal color)
        third: {
            100: '#4BAA94',
            200: '#449C88',
            300: '#3E8E7B'
        },
        //Hunter green (green color)
        fourth: {
            100: '#44744D',
            200: '#3C6744',
            300: '#355A3C'
        },
        //Gold (Gold color)
        fifth: {
            100: '#BEA423',
            200: '#AC9520',
            300: '#9B861C'
        }
    }
};



//export default tabsystemTheme;
